document.addEventListener('DOMContentLoaded', function() {
/* Add Code Here */

});
const buttonElement = document.getElementById('addBtn')
const inputElement = document.getElementById('input')
buttonElement.addEventListener('click', (event) => {
    const element = document.createElement('div');
    const itemContent = document.createElement('p');
    const deleteBtn = document.createElement('button');
    itemContent.textContent = inputElement.value;
    deleteBtn.textContent = 'Delete';
    deleteBtn.classList.add('deleteBtn');
    element.classList.add('todoItem');
    element.appendChild(itemContent);
    element.appendChild(deleteBtn);
    const parentElement = document.getElementById('todoList');
    parentElement.appendChild(element);
    deleteBtn.addEventListener('click', (event) => {
        element.remove();
    });
    
})

